Promotional info from the collected edition - &quot;Everyone wants to be loved. Even the shambling, macabre mockery of a man who brings terror to the town of Rumson and leaves blood in his wake. But when he sets his sights on Molly, beauty queen of Rumson High, she's going to be more than he can handle! THE DAILY SHOW writer Brendan Hay brings a AMERICAN PIE-meets-FRIDAY THE 13th sensibility to his horror graphic novel debut!&quot;

Thanks to Minutemen and RacerX-DCP for the scans of all five issues; please seed and enjoy. 

